$schema: "http://json-schema.org/draft-04/schema#"

id: "diagnosis"
title: Diagnosis
type: object
namespace: https://gdc.cancer.gov
category: clinical
project: '*'
program: '*'
description: >-
  Data from the investigation, analysis and recognition of the presence and nature
  of disease, condition, or injury from expressed signs and symptoms; also, the scientific
  determination of any kind; the concise results of such an investigation.
additionalProperties: false
submittable: true
downloadable: false
previous_version_downloadable: false
validators: null

systemProperties:
  - id
  - project_id
  - created_datetime
  - updated_datetime
  - state

links:
  - name: cases
    backref: diagnoses
    label: describes
    target_type: case
    multiplicity: many_to_one
    required: true

required:
  - submitter_id
  - age_at_diagnosis
  - primary_diagnosis
  - morphology
  - tissue_or_organ_of_origin
  - site_of_resection_or_biopsy

uniqueKeys:
  - [id]
  - [project_id, submitter_id]

deprecated:
  - micropapillary_features
  - mitotic_count
  - non_nodal_regional_disease
  - non_nodal_tumor_deposits
  - papillary_renal_cell_type
  - tumor_stage

